import React, { useState } from "react";
import styled from "styled-components";

function Detaylar(props) {
  const { veri } = props;
  return (
    <div>
      <p>gender:{veri.gender}</p>
      <p>Heigth:{veri.height}</p>
      <p>Mass:{veri.mass} </p>
      <p>BirthYear</p>
      <p>Eye Color:</p>
      <p>Hair Color:</p>
      <p>Skin Color: </p>
      {veri.films.map((item) => (
        <p>{item}</p>
      ))}
    </div>
  );
}

export default Detaylar;
